import React, { Component } from 'react';

const Arrow = (position, left, top) => (
  <i
    class='fas fa-arrow-circle-up'
    style={{ position: position, left: left, top: top }}
  ></i>
);

export class Static extends Component {
  render() {
    return (
      <div>
        <Arrow position='absolute' left='600px' />
      </div>
    );
  }
}

export default Static;
